import React from "react";
import "./navBar.css";
import logo from "../../assets/logo.png";
import contactImage from "../../assets/contact.png";
import { Link } from "react-scroll";

const NavBar = () => {
  return (
    <nav className="navBar">
      <img src={logo} alt="Logo" className="logo" />
      <div className="navBarMenu">
        <Link className="navBarMenuListItem">Home</Link>
        <Link className="navBarMenuListItem">About Me</Link>
        <Link className="navBarMenuListItem">Projects</Link>
        <Link className="navBarMenuListItem">Internships</Link>
        <Link className="navBarMenuListItem">Skills</Link>
      </div>
      <button className="contactMe">
        <img src={contactImage} alt="Contact" className="btnImage" />
        Contact Me
      </button>
    </nav>
  );
};

export default NavBar;
